# 12.2.2 REPONSE
def tracer_temperature(date1, date2):
    assert isinstance(date1, datetime.date) and isinstance(date2, datetime.date)
    data = np.array(list(filter(lambda x: x[0] >= date1 and x[0] <= date2, temperatures)))
    if not data.size:
        return
    plt.xticks(rotation = 30)
    plt.plot(data[:,0], data[:, 1], '-b', label='min')
    plt.plot(data[:, 0], data[:, 2], '-r', label='max')
    plt.plot(data[:, 0], data[:, 3], '-y', label='avg')
    plt.ylabel("Temperature en degre celcius")
    plt.title("Graphique des temperatures a l'aeroport de Quebec")
    plt.grid()
    plt.legend()
    plt.show()

tracer_temperature(datetime.date(2015, 12, 1), datetime.date(2015, 12, 31))